func (c *current) onCall1(name, args any) (any, error) {
	// Symbol followed by () - create Select with nil Receiver
	argRecord := Record(args.([]Keyed[Node]))
	return Select{
		Receiver: nil,
		Field:    name.(string),
		Args:     &argRecord,
		Loc: &SourceLocation{
			Line:   c.pos.line,
			Column: c.pos.col,
			Length: len(string(c.text)),
		},
	}, nil
}

